import { useState} from 'react';
const App = () => {
    const [Clicks,setClicks] =useState({Left:0,Right:0});

    const handleLeftClick = () =>{
        const newClicks ={
            ...Clicks,
            Left:Clicks.Left+1,

        }
        setClicks(newClicks);
    }

    const handleRightClicks = () =>{
        const newClicks ={
            Left:Clicks.Left,
            Right:Clicks.Right+1,
        }
        setClicks(newClicks);
    }

    return(
        <div>
            {Clicks.Left}
            <button onClick={handleLeftClick}>左</button>
            {Clicks.Right}
            <button onClick={handleRightClicks}>右</button>
        </div>
    )


}

export default App;
